import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { Col } from "../../components/layout.js";
import { Form, FormRow, FormGroup, FormLabel } from "../../components/form.js";
import {
  SelectDate,
  SelectMonthByName,
  SelectYear,
} from "../../components/dates.js";
import {
  Genders,
  GenderInput,
  Qualifications,
  QualificationInput,
  Specializations,
  SpecializationInput,
} from "../../components/users.js";
import axios from "axios";

export default function RegisterForm(props) {
  const today = new Date();
  const dispatch = useDispatch();

  const [fields, setfields] = useState({
    errorMessage: "",
    firstName: "",
    lastName: "",
    username: "",
    password: "",
    confirmPassword: "",
    dobDay: today.getDate(),
    dobMonth: today.getMonth() + 1,
    dobYear: today.getFullYear(),
    gender: Genders ? Genders[0] : "",
    isPhysician: "No",
    qualification: Qualifications ? Qualifications[0] : "",
    specialization: Specializations ? Specializations[0] : "",
  });

  function handleChange(e) {
    setfields({
      ...fields,
      [e.target.name]: e.target.value,
    });
  }

  async function handleSubmit(e) {
    e.preventDefault();
    try {
      // Generate DoB in 'YYYY-MM-DD' Format.
      const dob = new Date(fields.dobYear, fields.dobMonth - 1, fields.dobDay);

      const registerResponse = await axios.post(
        `http://localhost:4090/api/auth/register`,
        {
          username: fields.username,
          password: fields.password,
          firstName: fields.firstName.trim(),
          lastName: fields.lastName.trim(),
          isPhysician: fields.isPhysician === "Yes" ? true : false,
          dob: dob,
          gender: fields.gender,
          qualification:
            fields.isPhysician === "Yes" ? fields.qualification : "",
          specialization:
            fields.isPhysician === "Yes" ? fields.specialization : "",
        }
      );

      let registerData = registerResponse.data;
      // console.log(registerData);
      if (registerResponse.status !== 200) {
        throw new Error(registerData.message);
      }

      const signInResponse = await axios.post(
        `http://localhost:4090/api/auth/signin`,
        {
          username: fields.username,
          password: fields.password,
        }
      );

      let signInData = signInResponse.data;
      // console.log(signInResponse)
      if (signInResponse.status !== 200) {
        throw new Error(signInData.message);
      }
      // console.log("Last hour")
      dispatch({
        type: "session/set",
        payload: {
          ...signInData,
        },
      });
    } catch (err) {
      console.error(`Failed to register new user. ${err}`);
      setfields({
        ...fields,
        errorMessage: err.message,
      });
    }
  }

  return (
    <Form handleSubmit={handleSubmit}>
      {fields.errorMessage && (
        <FormRow className='justify-content-center'>
          <div className='alert alert-danger p-2' role='alert'>
            {fields.errorMessage}
          </div>
        </FormRow>
      )}
      <FormRow>
        <FormGroup className='col-sm-6'>
          <input
            id='registerInput1'
            type='text'
            name='firstName'
            className='form-control'
            placeholder='First name'
            value={fields.firstName}
            onChange={handleChange}
            aria-label='First name'
            required
          />
        </FormGroup>
        <FormGroup className='col-sm-6'>
          <input
            id='registerInput2'
            type='text'
            name='lastName'
            className='form-control'
            placeholder='Last name'
            value={fields.lastName}
            onChange={handleChange}
            aria-label='Last name'
            required
          />
        </FormGroup>
      </FormRow>
      <FormGroup>
        <input
          id='registerInput3'
          type='text'
          name='username'
          className='form-control'
          placeholder='Username'
          value={fields.username}
          onChange={handleChange}
          aria-label='Username'
          aria-describedby='usernameHelpBlock'
          autocomplete='off'
          required
        />
        <small
          id='usernameHelpBlock'
          className='Form-text text-muted help-text'>
          Username must contain only letters, numbers and periods.
        </small>
      </FormGroup>
      <FormRow className='my-sm-3'>
        <FormGroup className='col-sm-6 my-sm-0'>
          <input
            id='registerInput4'
            type='password'
            name='password'
            className='form-control'
            placeholder='Password'
            value={fields.password}
            onChange={handleChange}
            aria-label='Password'
            aria-describedby='passwordHelpBlock'
            minlength='8'
            maxlength='20'
            required
          />
        </FormGroup>
        <FormGroup className='col-sm-6 my-0'>
          <input
            id='registerInput5'
            type='password'
            name='confirmPassword'
            className='form-control'
            placeholder='Confirm Password'
            value={fields.confirmPassword}
            onChange={handleChange}
            aria-label='Confirm Password'
            aria-describedby='passwordHelpBlock'
            minlength='8'
            maxlength='20'
            required
          />
        </FormGroup>
        <FormGroup className='col-12 my-0'>
          <small
            id='passwordHelpBlock'
            className='form-text text-muted help-text'>
            Password must be 8-20 characters long and contain only letters,
            numbers and periods.
          </small>
        </FormGroup>
      </FormRow>
      <FormRow>
        <FormGroup className='my-0 col-sm-6'>
          <FormLabel for='registerInput6' className='md-font-sm text-muted'>
            Birthday
          </FormLabel>
          <FormRow>
            <FormGroup className='col-sm-auto'>
              <SelectMonthByName
                id='registerInput6'
                className='form-control'
                name='dobMonth'
                label='Month'
                shortForm={true}
                value={fields.dobMonth}
                handleChange={handleChange}
                required={true}
              />
            </FormGroup>
            <FormGroup className='col-sm-auto'>
              <SelectDate
                id='registerInput7'
                className='form-control'
                name='dobDay'
                label='Day'
                shortForm={true}
                value={fields.dobDay}
                handleChange={handleChange}
                required={true}
              />
            </FormGroup>
            <FormGroup className='col-sm-auto'>
              <SelectYear
                id='registerInput8'
                className='form-control'
                name='dobYear'
                label='Year'
