            id='registerInput9'
            className='form-control'
            name='gender'
            label='Gender'
            value={fields.gender}
            handleChange={handleChange}
            required={true}
          />
        </FormGroup>
      </FormRow>
      <FormGroup>
        <FormLabel for='registerInput10' className='md-font-sm text-muted'>
