                </label>
              </div>
            </div>
          </Col>
          <Col>
            <div className='border rounded py-2 px-1 w-100'>
              <div className='custom-control custom-radio'>
                <input
                  type='radio'
                  id='registerInput11'
                  name='isPhysician'
                  className='custom-control-input'
                  value='No'
                  checked={fields.isPhysician === "No"}
                  onChange={handleChange}
                />
                <label
                  for='registerInput11'
                  className='custom-control-label w-100'>
                  No
                </label>
              </div>
            </div>
          </Col>
        </FormRow>
      </FormGroup>
      {fields.isPhysician === "Yes" && (
        <FormRow>
          <FormGroup className='col-sm-6'>
            <FormLabel for='registerInput11' className='md-font-sm text-muted'>
              Qualification
            </FormLabel>
            <QualificationInput
              id='registerInput11'
              className='form-control'
              name='qualification'
              label='Qualification'
              value={fields.qualification}
              handleChange={handleChange}
              required={true}
            />
          </FormGroup>
          <FormGroup className='col-sm-6'>
            <FormLabel for='registerInput12' className='md-font-sm text-muted'>
              Specialization
            </FormLabel>
            <SpecializationInput
              id='registerInput12'
              className='form-control'
              name='specialization'
              label='Specialization'
              value={fields.specialization}
              handleChange={handleChange}
              required={true}
            />
          </FormGroup>
        </FormRow>
      )}
      <FormGroup>
        <p className='my-2 md-font-xs text-muted'>
          By clicking on Register, you agree to our Terms and Conditions.
        </p>
      </FormGroup>
      <FormRow className='justify-content-center'>
        <button
          id='registerButton1'
          type='submit'
          className='btn btn-success col-6'>
          Register
        </button>
      </FormRow>
    </Form>
  );
